import React from "react";
import { Card } from "antd";

const { Meta } = Card;
export default function ItemPhim() {
  return (
    <Card
      hoverable
      style={{ width: 240 }}
      cover={<img alt="example" src="https://picsum.photos/200" />}
    >
      <Meta title="Europe Street beat" description="www.instagram.com" />
    </Card>
  );
}
